import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from 'react-router-dom';
import {
    Button,
    Card,
    Container,
    Row,
    Col
} from 'react-bootstrap';
import './Footer.css';

function Footer()
{
    return (
        <Row className="Footer">
            <div className="Main-footer">
                <Col md={4} style={{ backgroundColor: "#780BD4" }}>
                    <h1>Test1</h1>
                </Col>
                <Col md={4} style={{ backgroundColor: "#4C0CF6" }}>
                    <h1>Test2</h1>
                </Col>
            </div>
        </Row>
    );
}

export default Footer;
